import { useDispatch, useSelector, connect } from 'react-redux'
import { getParkingSpot, selectParkingSpot, selectLoading, selectError } from '../reduxe/slices/parkingActions';

import { Post } from '../components/Post';
import { TagsBlock } from '../components/TagsBlock';
import { CommentsBlock } from '../components/CommentsBlock';
import axios from '../axios';

export const Home = ({
  parkingSpot,
  loading,
  error,
  getParkingSpot,
}) => {
   const dispatch = useDispatch();
    useEffect(() =>{
    
      getParkingSpot();
  }, []);
  if (loading) {
    return <div>Loading...</div>;
  }

  if (error) {
    return <div>Error: {error}</div>;
  }
  return (
    <>
    <div>
    {parkingSpot && (
      <div>
        <h2>{parkingSpot.title}</h2>

        {/* Виводьте інші властивості парковочного місця за потребою */}
      </div>
    )}
  </div>
      {/* <Grid container spacing={4}>
        <Grid xs={12} item>
          {[...Array(5)].map(() => (
            <Post
              id={1}
              title="парковка"
              imageUrl="https://kievvlast.com.ua//project/resources/2022/01/OOKA3t2g.jpg"

              tags={[]}
              isEditable
            />
          ))}
        </Grid>
        <Grid xs={0} item>

        </Grid>
      </Grid> */}
    </>
  );
};
const mapStateToProps = (state) => ({
  parkingSpot: selectParkingSpot(state),
  loading: selectLoading(state),
  error: selectError(state),
});

const mapDispatchToProps = {
  getParkingSpot,
};

export default connect(mapStateToProps, mapDispatchToProps)(Home);
